function lengthOfLongestSubstring(s: string): number {
	const arr: string[] = s.split("");
	let count: number = 0;
	const numArr: number[] = [];
	const curWord: string[] = [];
	for (var i: number = 0; i <= arr.length - 1; i++) {
		curWord.push(arr[i]);
		count = 1;
		// console.log(curWord);
		numArr.push(count);
		for (var j: number = i + 1; j <= arr.length - 1; j++) {
			if (curWord.includes(arr[j])) {
				count = 0;
				curWord.length = 0;
				break;
			}
			curWord.push(arr[j]);
			// console.log(curWord);
			count = curWord.length;
			numArr.push(count);
		}
	}
	if (numArr.length === 0) {
		return 0;
	}
	return Math.max(...numArr);
}

